import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import AudioRetrieval from './AudioRetrieval';
import ProfileSearch from './ProfileSearch';

function App() {
    return (
        <>
        <Router>
            <Routes>
                <Route path="/" element={<AudioRetrieval />} />
            </Routes>
        </Router>
        </>
    );
}
export default App;
